import React, {Component} from 'react'
import styled from 'styled-components'
import { Text } from 'rebass'
import AppBody from '../AppBody'
import Column, { AutoColumn, ColumnCenter } from '../../components/Column'
import Row, {RowBetween, RowEnd} from '../../components/Row'
import CloseBtn from '../../assets/images/closeBtn.svg'
import { Pie } from '@ant-design/charts';

const BodyWrapper = styled(AutoColumn)`
`;

const HeadContainer = styled(RowBetween)`
  margin-top: 50px;
  padding: 0 20px;
  height: 44px;
`;

export default class AssetsMDetail extends Component<any, any> {

    goBack = () => {
        this.props.history.goBack();
    }
    render() {
        var data = [
            {
                type: '分类一',
                value: 27,
            },
            {
                type: '分类二',
                value: 25,
            },
            {
                type: '分类三',
                value: 18,
            },
            {
                type: '分类四',
                value: 15,
            },
            {
                type: '分类五',
                value: 10,
            },
            {
                type: '其他',
                value: 5,
            },
        ];
        var config = {
            appendPadding: 10,
            data: data,
            angleField: 'value',
            colorField: 'type',
            radius: 1,
            innerRadius: 0.6,
            label: {
                type: 'inner',
                offset: '-50%',
                content: '{value}',
                style: {
                    textAlign: 'center',
                    fontSize: 14,
                },
            },
            interactions: [{ type: 'element-selected' }, { type: 'element-active' }],
            statistic: {
                title: false,
                content: {
                    style: {
                        whiteSpace: 'pre-wrap',
                        overflow: 'hidden',
                        textOverflow: 'ellipsis',
                    },
                    formatter: function formatter() {
                        return 'AntV\nG2Plot';
                    },
                },
            },
        };
        return <Pie {...config} />;
        // return (
        //     <AppBody>
        //         <BodyWrapper gap={'md'}>
        //             <HeadContainer>
        //                 <Text fontSize='23px' fontWeight='bold' color='#333333'>Assets</Text>
        //                 <img src={CloseBtn} alt="" width='15px' height='15px' onClick={this.goBack} />
        //             </HeadContainer>
        //             <Text fontSize='18px' fontWeight='500' color='#333333' marginLeft='25px'>Assets distribution</Text>
        //             <div>
        //             </div>
        //         </BodyWrapper>
        //     </AppBody>
        // );
    }
}
